import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';


class Education extends Component {
    render(){
        return (
            <Grid>
                <Cell col={4}>
                    <p style={{margin: '10px', paddingRight: '50em'}}>{this.props.startYear} - {this.props.endYear}</p>
                </Cell>
                <Cell col={8}> 
                    <h2 style={{margin: '0px'}}>{this.props.schoolName}</h2>
                    <h3 style={{margin: '15px'}}>{this.props.degree}</h3>
                    <p>{this.props.schoolDescription}</p>

                </Cell>
            </Grid>
        )
    }
}

export default Education;
